import React, { Fragment } from 'react';

const AppMap = (props) => {
    //console.log(props.axtr);
    //const {title, desc} = props.axtr;
    return (
        <Fragment> 
            <div>
               <h1>{props.todoapp.id}</h1>
                <h2>{props.todoapp.title}</h2>
                <p>{props.todoapp.desc}</p>
             </div>
        </Fragment>
    );
};
export default AppMap;
